import React, { useEffect, useRef, useState } from "react";

// Components
import Header from '../components/Header/Header';
import LandingArticle from '../components/LandingArticle/LandingArticle';
import Article from '../components/Article/Article';
import Testimonials from '../components/Testimonials/Testimonials';
import CourseSchedule from '../components/CourseSchedule/CourseSchedule';
import JaredSpool from '../components/JaredSpool/JaredSpool';
import Pricing from '../components/Pricing/Pricing';
import Calendar from '../components/Calendar/CalendarOct';
import VideoSeries from '../components/VideoSeries/VideoSeries';
import Footer from '../components/Footer/Footer';
import Modal from "../components/Modal/Modal";
import TestComponent from "../components/TestComponent/TestComponent";
import PurchaseBox from "../components/PurchaseBox/PurchaseBox";
import bgVideo from "../../public/videos/bg_placeholder.MP4"


export default function Home() {
    return (
        <div className="App">
            <video autoPlay loop muted className="background-video">
                <source src={bgVideo} type="video/mp4" />
            </video>
            <Header />

            < LandingArticle >
            <div className="LandingButtons">
                <div className="danceButton">DANCE</div>
                <div className="donateButton">DONATE</div>
                <div className="partnerButton">PARTNER</div>
            </div>
            </LandingArticle >


            <Footer />
        </div>
    );
}
